import './Main.css';

function Main() {
  return (
    <>
    <section class="profile">
            <div class="profile__info">
                <img class="profile__avatar" src="#" alt="Аватар"/>
                <div class="profile__edit"/>
                <h1 class="profile__user-name"/>
                <p class="profile__description"/>
                <button class="button profile__edit-button" type="button"/>
            </div>
            <button class="button profile__add-button" type="button"/>
        </section>
        <section class="elements"/>
    </>
  );
}

export default Main;
